INSERT INTO `kandidat` (`id`, `nama`, `nomor_urut`, `visi`, `misi`, `foto_url`, `created_at`) VALUES
(1, 'Masta Hendri Setiawan Lature', 1, 'Menjadikan PMK sebagai wadah untuk menjangkau, melayani, dan pembentukan karakter yang berpusat pada Kristus, serta berdampak bagi lingkungan sekitar', 'Menjadikan PMK sebagai wadah untuk bertumbuh dan berkembangnya suatu potensi talenta yang melayani dan spritual. Membangun lingkungan persekutuan yang hangat dan inklusif. Merangkul seluruh civitas akademika ITERA. Membangun serta menjalin hubungan yang baik antara PMK dengan Mitra. Melakukan kegiatan sosial dan pengabdian masyarakat. Regenerasi PMK ITERA melalui pemuridan yang berlandaskan Alkitab', 'https://res.cloudinary.com/dm3zixaz4/image/upload/v1763314983/Kandidat_1_yazots.png', '2025-11-22 19:54:41'),
(2, 'Erwandi Pantun Pardede', 2, 'Mewujudkan PMK ITERA sebagai wadah pembentukan mahasiswa Kristen yang berkarakter Kristus yang memimpin dengan kasih, melayani dengan kerendahan hati, dan membangun kesatuan dalam tubuh Kristus.', 'Menumbuhkan iman dan karakter Kristus dalam diri setiap mahasiswa Kristen. (Kolose 2:6–7). Membentuk kepemimpinan yang berlandaskan kasih dan kerendahan hati. (Markus 10:45). Membangun kesatuan tubuh Kristus di lingkungan kampus yang berlandaskan sifat gerejawi. (Efesus 4:3–6)', 'https://res.cloudinary.com/dm3zixaz4/image/upload/v1763314983/Kandidat_2_l502wt.png', '2025-11-22 19:54:41');
